function Calcalorie(){
    const [searchInput,setSearch]=useState("")
    function search(event){
        const value=event.target.value
        setSearch(value)
        }
    return(
            <div>
                <form>
                Food:<input type="search" onChange={search} name="food" placeholder="search..." value={searchInput}/>
                <input type="submit" />

                </form>

            </div>


    )    



}

export default Calcalorie;
